import React, { Component } from 'react';
import Interviews from './Interviews';
import NewInterview from './NewInterview';
import NewJobs from './NewJobs';
import TestSkills from './TestSkills';
import AboutUs from './AboutUs';
import { Route, NavLink, Switch } from 'react-router-dom';
import LeftMenu from './LeftMenu'
import RightMenu from './RightMenu'
import { Drawer, Button } from 'antd';

class Header extends Component {
      state = {
        current: 'mail',
        visible: false
      }
      showDrawer = () => {
        this.setState({
          visible: true,
        });
      };
    onClose = () => {
        this.setState({
          visible: false,
        });
      };
    render() {
        return (
            <div>
            <nav className="menuBar">
              <div className="logo">
                <a href="">logo</a>
              </div>
              <div className="menuCon">
                <div className="leftMenu">
                  <LeftMenu />
                </div>
                <div className="rightMenu">
                    <RightMenu />
                </div>
                <Button className="barsMenu" type="primary" onClick={this.showDrawer}>
                  <span className="barsBtn"></span>
                </Button>
                <Drawer
                  title="Company Name"
                  placement="right"
                  closable={false}
                  onClose={this.onClose}
                  visible={this.state.visible}
                >
                  <LeftMenu />
                  <RightMenu />
                </Drawer>
            </div>
            </nav>

            <Switch>
                    <Route path = "/test-skills" exact component = { TestSkills } />
                    <Route path = "/interviews/" exact  component = { Interviews } />
                    <Route path = "/"  exact component = { AboutUs } />
                    <Route path = "/interviews/new" exact component = { NewInterview } />
                    <Route path = "/new-jobs" exact component = { NewJobs } />
                    {/*<Route path = "/:id" exact  component = { FullPost } />*/}
            </Switch>
            </div>
        );
      }
    }

export default Header;


